import Countries from "./Countries";

const SearchResult = (countries) => {
    if (countries.length > 10) {
        return <p>Too many matchers, specify another filter</p>        
    } else {
        return countries.map(country => 
        <p>{country.name}</p>)
    }
}

export default SearchResult
